// import React from 'react';
import React, { useEffect } from 'react';


const CourseSection = () => {
    useEffect(() => {
        if (window.anime) {
            window.anime({
                targets: '.course-card',
                opacity: [0, 1],
                translateY: [40, 0],
                delay: window.anime.stagger(100),
                duration: 800,
                easing: 'easeOutQuad'
            });
        }
    }, []);
    const courses = [
        {
            title: "Full-Stack Web Development",
            description: "Master both front-end and back-end technologies to build complete web applications. Learn HTML, CSS, JavaScript, React, Node.js, and database integration.",
            duration: "12 Weeks",
            startDate: "Starts Jun 1",
            image: "images/web3.png",
            price: "¥350,000",
            category: "Web Development"
        },
        {
            title: "Data Science & Analytics",
            description: "Learn to analyze and interpret complex data sets using Python, R, SQL, and visualization tools. Includes machine learning fundamentals and real-world projects.",
            duration: "16 Weeks",
            startDate: "Starts May 15",
            image: "images/data3.png",
            price: "¥420,000",
            category: "Data Science"
        },
        {
            title: "Cybersecurity Fundamentals",
            description: "Develop essential skills in network security, ethical hacking, threat detection, and security management. Includes preparation for industry certifications.",
            duration: "14 Weeks",
            startDate: "Starts Jul 10",
            image: "images/cyber2.png",
            price: "¥380,000",
            category: "Cybersecurity"
        },
        {
            title: "Cloud Architecture & Solutions",
            description: "Master cloud infrastructure deployment, management, and scaling using AWS, Azure, and Google Cloud. Learn containerization, microservices, and cloud security best practices.",
            duration: "10 Weeks",
            startDate: "Starts Jun 15",
            image: "images/cloud1.png",
            price: "¥365,000",
            category: "Cloud Computing"
        },
        {
            title: "Artificial Intelligence & Machine Learning",
            description: "Explore AI concepts, algorithms, and practical applications. Build neural networks, implement machine learning models, and develop solutions for real-world business challenges.",
            duration: "18 Weeks",
            startDate: "Starts Jul 5",
            image: "images/ai1.png",
            price: "¥450,000",
            category: "Artificial Intelligence"
        },
        {
            title: "Internet of Things (IoT) Development",
            description: "Learn to design, build, and deploy connected smart devices and systems. Master sensor integration, embedded programming, data collection, and IoT security fundamentals.",
            duration: "14 Weeks",
            startDate: "Starts Aug 3",
            image: "images/iot1.png",
            price: "¥395,000",
            category: "Internet of Things"
        }
    ];

    return (
        <section className="section" id="courses">
            <div className="container">
                <div className="section-header">
                    <h2>Our Courses</h2>
                    <p>Explore our wide range of IT courses designed to prepare you for the careers of today and tomorrow.</p>
                </div>
                <div className="cards">
                    {courses.map((course, index) => (
                        <div className="card course-card" key={index}>
                            <div className="card-img">
                                <img src={course.image} alt={course.title} />
                            </div>
                            <div className="card-body">
                                <div className="course-meta">
                                    <div><span className="material-icons" style={{ fontSize: '16px' }}>access_time</span> {course.duration}</div>
                                    <div><span className="material-icons" style={{ fontSize: '16px' }}>event</span> {course.startDate}</div>
                                </div>
                                <h3>{course.title}</h3>
                                <p>{course.description}</p>
                                <a href="#" className="btn btn-outline" style={{ marginTop: 'auto' }}>View Details</a>
                            </div>
                            <div className="card-footer">
                                <span className="badge badge-primary">{course.category}</span>
                                <span>{course.price}</span>
                            </div>
                        </div>
                    ))}
                </div>
                <div style={{ textAlign: 'center', marginTop: '2rem' }}>
                    <a href="#" className="btn btn-primary" id="viewAllCoursesBtn">View All Courses</a>
                </div>
            </div>
        </section>
    );
};

export default CourseSection;
